perspectives.style:
@settings {
  template: systems;
  theme: dark;
  connections: undirected;
  element-text-align: bottom;
  element-size: 3;
  font-size: 15;
  cluster: "card", "rank", "deck", "Suit";
  connection-size: 1;
  layout-preset: auto;
  include: card-connection, rank-connection, deck-connection, undefined-connection, element, loop;
}

element["suit"="cups"], element["card"*="c"] {
  color: #487bba;
}

element["suit"="wands"], element["card"*="w"] {
  color: #f53b23;
}

element["suit"="swords"], element["card"*="s"] {
  color: #cf9236;
}

element["suit"="pentacles"], element["card"*="p"] {
  color: #00682a;
}

element["suit"="major"], element["card"*="X"] {
  color: #5e4fa2;
}

element["element type"="variant"] {
  shape: rectangle;
  height: 47.5;
  width: 27.5;
  padding: 1;
}

element["element type"="deck"] {
  shape: rectangle;
  height: 95;
  width: 55;
  padding: 1;
}

element["element type"="deck"] {
  size: 20;
  padding: 1;
}

element["element type"="card"] {
  size: 10;
  text-align: center;
}

element["element type"="rank"] {
  size: 13;
  text-align: center;
  font-size: 20;
  font-color: black;
}

element["element type"="suit"] {
  size: 20;
}
